import React from 'react';

import Wrapper from '../UI/Wrapper';
import { Grid } from '@mui/material';
import BusinessIcon from '@mui/icons-material/Business';

import classes from './ApplicationBanner.module.css';

const ApplicationForm = () => {
  return (
    <Wrapper>
      <Grid 
        container 
        spacing={2}
        >
        <Grid container item direction="row" xs={12} md={6}>
          <Grid item xs={12} md={12} sx={{marginBottom: "5%"}}>
            <h2>Ad eos saepe lucilius, noster postulant philosophia ea usu, qui dicta sadipscing te.</h2>
          </Grid>
          <Grid container item spacing={6}>
            <Grid item md={6}>
              <BusinessIcon color="secondary"/>
              <p className={classes["text-align"]}>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum.</p>
            </Grid>
            <Grid item md={6}>
              <BusinessIcon color="secondary"/>
              <p className={classes["text-align"]}>Et has minim elitr intellegat. Mea aeterno eleifend antiopam ad, nam no suscipit quaerendum.</p>
            </Grid>
          </Grid>
        </Grid>
        <Grid item xs={12} md={6} style={{marginTop: "5%"}}>
          <div className={classes["banner-element"]}>FORTUNE <br/> 500</div>
        </Grid>
      </Grid>
    </Wrapper>
  )
};

export default ApplicationForm;
